import React from 'react';

import classes from './Medidas.module.css'

const Medidas = () => {
    return ( 
        <div className={classes.Medidas}>
            <h2>Medidas</h2>
            <form>
                <div className={classes.title}><span>Altura</span><span>x</span><span>Ancho</span></div>

                <label><span></span><input type="checkbox"  value="x"/></label>

                <label><span>1.20</span><span>x</span><span>1.20</span><input type="checkbox"  value="x"/></label>

                <label><span>1.40</span><span>x</span><span>1.20</span><input type="checkbox"  value="x"/></label>

                <label><span>1.60</span><span>x</span><span>1.20</span><input type="checkbox" value="x"/></label>

            </form>
        </div>
     );
}
 
export default Medidas;
